import React, { Component } from 'react'
import Button from '@material/react-button';

class MoviesButton extends Component {
 render() {
  return (
    <Button
      raised
      className='favorite-movies-btn'>
      onClick={this.props.getMovies}
      Get Favorite Movies
    </Button>
   )
 }
}

export default MoviesButton
